import pandas as pdimport pytestfrom oilanalytics.freight.tce import tce_calcdef test_tc2():    dd = {        'FlatRate': 14.73,        'PortCosts': 91276.748,        'WorldScale': 80.56,        'RottA': 0.35,        'RottB': 0.57,    }    data = pd.DataFrame(dd, index=[pd.to_datetime('2020-06-25')])    res = tce_calc.calc('tc2', data)    assert res['GrossFreight']['2020-06-25'] == pytest.approx(469632.97, 0.1)    # assertAlmostEqual(hist['GrossFreight']['2020-06-25'], 469632.97, 2)    # assertAlmostEqual(hist['BunkerCost']['2020-06-25'], 200407.89, 2)def test_tc5():    dd = {        'FlatRate': 24.54,        'PortCosts': 74534.074,        'WorldScale': 80,    }    data = pd.DataFrame(dd, index=[pd.to_datetime('2020-06-25')])    res = tce_calc.calc('tc5', data)    assert res['GrossFreight']['2020-06-25'] == pytest.approx(1094610.0, 0.1)